INSERT INTO public.units VALUES ('14.702.257/0009-57', 'AME - Ambulatório Municipal de Especialidades', 'Av Filadélfia, Nº 568, Setor Oeste', 'Araguaína', 'TO', '77.816-540', '(63) 3411-8598', 'https://isac.org.br/wp-content/uploads/2020/05/logoame.png', 'ambulatorio', 'O Ambulatório Municipal de Especialidades - AME realiza cerda de 40 mil exames anuais, tais como: endoscopia, eletrocardiograma, ultrassonografia, raio-x, exames laboratoriais, entre outros. Além disso, oferece consultas médicas nas seguintes especialidades: cardiologia, dermatologia, endocrinologia, gastroenterologia, neurologia, ortopedia, pequena cirurgia, pediatria, psiquiatria, reumatologia e cirurgia pediátrica. Em abril/2020 foi firmado Termo de Colaboração entre a Prefeitura Municipal de Araguaína e o ISAC com vistas à execução de ações e serviços complementares de prevenção e combate à Covid-19 no âmbito do Município de Araguaína (TO).', NULL, 2, '2020-10-05 14:39:56+00', '2020-10-05 14:39:56+00');
INSERT INTO public.units VALUES ('14.702.257/0006-04', 'Anatólio Dias Carneiro', 'Rua dos Pinheiros, Nº 1018, Setor Raizal', 'Araguaína', 'TO', '77.826-552', '(63) 3414-0755/3413-2587/3415-1387', 'https://isac.org.br/wp-content/uploads/2020/05/UPA-anatolio-cor.png', 'upa', 'O Contrato de Gestão Emergencial entre o ISAC e o Município de Araguaína por intermédio da Secretaria de Saúde, situada na cidade de Araguaína (TO), iniciou em 16/04/2018, com duração de seis meses. O segundo Termo Aditivo prorrogou a vigência do Contrato Emergencial pelo período de três meses ou até a conclusão de novo Chamamento Público. Em 11/01/2019, foi assinado o Contrato de Gestão nº 001/2019 entre o Município de Araguaína e o ISAC para gerenciamento, operacionalização e execução das ações e serviços de saúde do HMA, AME, UTI e UPA Anatólio Dias. A unidade tem capacidade para atender até 250 pacientes por dia. Sua área de abrangência é de 150 a 200mil habitantes.', NULL, 3, '2020-10-05 14:47:52+00', '2020-10-05 14:47:52+00');
INSERT INTO public.units VALUES ('14.702.257/0005-23', 'Day Clinic', 'Av Primeiro de Janeiro, Nº 904, Setor Central', 'Araguaína', 'TO', '77.803-140', '(63) 3416-0300', 'https://isac.org.br/wp-content/uploads/2020/05/Logo-Day-Clinic.png', 'own_service', 'A filial foi criada em 20 de julho de 2016 e está situada em Araguaína (TO). A Unidade tem o objetivo de prestar serviços próprios de atendimento de urgência, emergência, ambulatório e SADT (Serviço de Apoio Diagnóstico Terapêutico), bem como serviços gratuitos em parceria com o Ministério da Saúde e SUS.', NULL, 19, '2020-10-05 18:41:01+00', '2020-10-05 18:41:01+00');
INSERT INTO public.units VALUES ('14.702.257/0017-67', 'HGP', 'Q 201 Sul Avenida Lo 5, Plano Diretor Sul', 'Palmas', 'TO', '77.015-206', NULL, 'https://isac.org.br/wp-content/uploads/2020/09/logo-portal-transparencia-hgp.png', 'covid-uti', 'O maior hospital público do Tocantins, o HGP – Hospital Geral de Palmas, adotou o Protocolo ISAC em 30 leitos da UTI – Unidade de Terapia Intensiva.Voltados aos pacientes infectados pelo Coronavírus, os leitos são operacionalizados e geridos de forma compartilhada entre o ISAC – Instituto Saúde e Cidadania e o Governo do Tocantins. Baseado no Protocolo ISAC, os pacientes internados recebem atendimento humanizado, seguro e de qualidade. Além disso, há governança assistencial eficiente com gestão de custos sustentável.', NULL, 4, '2020-10-05 18:42:11+00', '2020-10-05 18:42:11+00');
INSERT INTO public.units VALUES ('14.702.257/0007-95', 'HMA - Hospital Municipal de Araguaína', 'Av Perimetral, Nº 650, Loteamento Manoel Gomes da Cunha', 'Araguaína', 'TO', '77.818-060', '(63) 3414-0734/3413-2160', 'https://isac.org.br/wp-content/uploads/2020/05/logo-png-hma.png', 'hospital', 'O Contrato de Gestão Emergencial entre o ISAC e o Município de Araguaína por intermédio da Secretaria de Saúde, situada na cidade deAraguaína (TO), iniciou em 16/04/2018, com duração de seis meses. O segundo Termo Aditivo prorrogou a vigência do Contrato Emergencial pelo período de três meses ou até a conclusão de novo Chamamento Público. Em 11/01/2019, foi assinado o Contrato de Gestão nº 001/2019 entre o Município de Araguaína e o ISAC para gerenciamento, operacionalização e execução das ações e serviços de saúde do HMA, AME, UTI e UPA Anatólio Dias. O HMA funciona 24 horas diariamente. Os serviços prestados são internação e cirurgias eletivas e de urgência nas especialidades pediatria e oftalmologia. Na ala ambulatorial são realizadas consultas médicas especializadas nas áreas de pediatria, cardiologia, neurologia, psiquiatria, dermatologia, oftalmologia, endocrinologia, gastroenterologia, reumatologia e urologia. Os exames oferecidos na ala ambulatorial são Eletrocardiograma (ECG), Biometria, Ultrassonografia Ocular, Ultrassonografia (USG), Endoscopia (EDA), Raios-X, Exames Laboratoriais, Colonoscopia e Retossigmoidoscopia.', NULL, 5, '2020-10-05 18:44:09+00', '2020-10-05 18:44:09+00');
INSERT INTO public.units VALUES ('14.702.257/0008-76', 'HOSPIGAF - Hospital Geral Professor IB Gatto Falcão', 'R Santo Antônio, SN, Centro, Rio Largo', 'Maceió', 'AL', '57.100-000', '(82) 3261-2414', 'https://isac.org.br/wp-content/uploads/2020/05/ibgatto.png', 'hospital', 'O contrato de Gestão do Hospital Geral Professor Ib Gatto Falcão – Hospigaf, situado na cidade de Rio Largo (AL), iniciou-se em 31 de julho de 2018 e com duração de 12 meses.O Hospigaf possui capacidade de atendimento de até 250 pacientes diários. Realiza atendimentos de urgência e emergência (clínica médica e pediatria), e internação (clínica médica, pediatria, neonatologia e saúde mental). Há projeto de ampliação para internação de cirurgia geral e ortopedia. Realiza exames de radiografia, ultrassonografia e análises clínicas. Possui 51 leitos com ampliação prevista para mais 70 leitos.', NULL, 6, '2020-10-05 18:59:30+00', '2020-10-05 18:59:30+00');
INSERT INTO public.units VALUES ('14.702.257/0016-86', 'Hospital Estadual de Combate à Covid-19', 'Q 501 SUL AVENIDA NS A, Conjunto 02, Lote 10 - Plano Diretor Sul', 'Palmas', 'TO', '77.016-008', NULL, 'https://isac.org.br/wp-content/uploads/2020/09/logo-portal-transparencia.png', 'covid-hospital', 'Unidade preparada para atender 70 tocantinenses, sendo 60 em leitos clínicos e 10 em UTI -Unidade de Terapia Intensiva.O HECC iniciou suas atividades de forma gradativa com seis leitos clínicos e um de UTI. Posteriormente, esse número saltou para 12 leitos clínicos e cinco de UTI. Os pacientes atendidos pelo HECC são encaminhados pela Central Estadual de Regulação, que é gerenciada pela Secretaria de Saúde. A unidade é restrita aos pacientes com Covid-19. Por segurança, não há acompanhantes ou visitas. Diariamente, o hospital fornece boletim do estado de saúde aos familiares indicados pelo paciente ou seus responsáveis legais. Nos casos com autorização médica são realizadas visitas virtuais para acompanhamento do paciente.', NULL, 12, '2020-10-05 19:01:51+00', '2020-10-05 19:01:51+00');
INSERT INTO public.units VALUES ('14.702.257/0019-29', 'HRA - Hospital Regional de Araguaína', 'Av. Tocantins, S/N, Setor Anhanguera', 'Araguaína', 'TO', '77.818-550', '(63) 3411-2801 / 2802', 'https://isac.org.br/wp-content/uploads/2020/09/logo-portal-transparencia-hra.png', 'uti-covid', 'Oferecer um atendimento humanizado, seguro e de qualidade aos tocantinenses é a missão do ISAC – Instituto Saúde e Cidadania à frente da gestão de 17 leitos em UTI – Unidade de Terapia Intensiva no Hospital Regional de Araguaína. Todos os leitos são destinados ao atendimento de pacientes infectados pelo Coronavírus, de forma a oferecer tratamento baseado no Protocolo ISAC, que alinha gestão sustentável dos recursos com governança assistencial efetiva.', NULL, 9, '2020-10-05 19:19:09+00', '2020-10-05 19:19:09+00');
INSERT INTO public.units VALUES ('14.702.257/0018-48', 'HRG - Hospital Regional de Gurupi', 'Rua Presidente Juscelino Kubitschek, Nº 1541, Setor Central', 'Gurupi', 'TO', '77.405-110', '(63) 3315-0241 / 0238', 'https://isac.org.br/wp-content/uploads/2020/09/logo-portal-transparencia-hrg.png', 'uti-covid', 'Os tocantinenses infectados pelo Coronavírus e que precisam de atendimento uma UTI – Unidade de Terapia Intensiva em Gurupi no Tocantins, contam com 20 leitos que foram operacionalizados e ampliados pelo ISAC – Instituto Saúde e Cidadania. Os leitos foram disponibilizados no HRG – Hospital de Regional de Gurupi e possuem gestão compartilhada com o Governo do Tocantins. O Protocolo ISAC foi adotado para garantir governança assistencial eficiente com gestão de custos sustentável. O atendimento oferecido é humanizado, seguro e de qualidade.', NULL, 10, '2020-10-05 19:22:01+00', '2020-10-05 19:22:01+00');
INSERT INTO public.units VALUES ('14.702.257/0001-08', 'ISAC - Instituto Saúde e Cidadania', 'ST SCS QD 09 Bloco C, ED. Parque Cidade Corporate Parte V-1, Asa Sul', 'Brasília', 'DF', '70.308-200', '(61) 3021-2976', 'https://isac.org.br/wp-content/uploads/2020/05/logo-vertical-ISAC.png', 'sede', 'O Instituto Saúde e Cidadania – ISAC é Organização Social (OS) sem fins lucrativos, fundado sob forma de associação civil no ano de 2011, com atuação em todo território nacional e com Sede em Brasília. O ISAC está inserido no terceiro setor (iniciativas privadas de origem na sociedade civil com fins de utilidade pública) para implementar sua Missão de promover a gestão otimizada na área da saúde, com benefícios aos Usuários, Parceiros e Unidades. O Instituto valoriza ações que fazem sinergismo com sua Missão, por isso trabalha com profissionais experientes e parcerias estratégicas com instituições nacionais e internacionais, além de atuar na área de ensino, pesquisa, assistência social e trabalhar de forma sustentável', 'https://isac.org.br/wp-content/uploads/2020/07/Organograma-ISAC-09.07.2020.pdf', 20, '2020-10-05 19:29:42+00', '2020-10-05 19:29:42+00');
INSERT INTO public.units VALUES ('14.702.257/0014-14', 'Multicentro de Saúde Carlos Gomes', 'Rua Carlos Gomes, Nº 270', 'Salvador', 'BA', '40.060-325', NULL, 'https://isac.org.br/wp-content/uploads/2020/08/site-icon.png', 'ambulatorio', NULL, 'https://isac.org.br/wp-content/uploads/2020/09/Organograma-Multicentro-de-Saúde-Carlos-Gomes-1.png', 11, '2020-10-05 19:36:09+00', '2020-10-05 19:36:09+00');
INSERT INTO public.units VALUES ('14.702.257/0015-03', 'Multicentro de Saúde Vale das Pedrinhas', 'Av. Vale das Pedrinhas', 'Salvador', 'BA', '41.905-615', NULL, 'https://isac.org.br/wp-content/uploads/2020/08/icon-site.png', NULL, NULL, 'https://isac.org.br/wp-content/uploads/2020/09/Organograma-Multicentro-de-Saúde-Vales-das-Pedrinhas.png', 15, '2020-10-05 19:46:29+00', '2020-10-05 19:46:29+00');
INSERT INTO public.units VALUES ('14.702.257/0015-03', 'Multicentro de Saúde Vale das Pedrinhas', 'Av. Vale das Pedrinhas', 'Salvador', 'BA', '41.905-615', NULL, 'https://isac.org.br/wp-content/uploads/2020/08/icon-site.png', 'ambulatorio', NULL, 'https://isac.org.br/wp-content/uploads/2020/09/Organograma-Multicentro-de-Saúde-Vales-das-Pedrinhas.png', 18, '2020-10-05 19:56:59+00', '2020-10-05 19:56:59+00');
INSERT INTO public.units VALUES ('14.702.257/0004-42', 'UPA Benedito Bentes', 'AV Antônio Lisboa de Amorim, SN, Benedito Bentes', 'Maceió', 'AL', '57.085-160', '(82) 3313-7527', 'https://isac.org.br/wp-content/uploads/2020/05/Logo-PNG-benedito-Bentes-.png', 'upa', 'O Contrato de Gestão da Unidade de Pronto Atendimento – UPA Benedito Bentes, situada na cidade de Maceió (AL), iniciou-se em 18 de abril de 2016 e com duração de cinco anos. Unidade tem capacidade para atender até 350 pacientes por dia. Sua área de abrangência é de 200 a 300 mil habitantes. Os atendimentos oferecidos são Clínica Geral, Pediatria, Ortopedia e Odontologia. A Unidade possui Sala Amarela (15 leitos, sendo: cinco pediátricos em ambiente especializado e dois leitos de isolamento) e Sala Vermelha (com quatro leitos).', NULL, 21, '2020-10-05 19:59:14+00', '2020-10-05 19:59:14+00');
INSERT INTO public.units VALUES ('14.702.257/0011-71', 'UPA Cidade Nova', 'TV We 16, SN, Cidade Nova', 'Ananindeua', 'PA', '67.130-440', '(91) 98522-6866', 'https://isac.org.br/wp-content/uploads/2020/05/Logo-Cidade-Nova-PNG.png', 'upa', 'O Contrato de Gestão da UPA Cidade Nova, situada na cidade de Ananindeua (PA), iniciou em 31/10/2018, com duração de 12 meses. A unidade realiza, em média, 13 mil atendimentos por mês, com capacidade para atender até 50 pacientes simultaneamente. Os atendimentos oferecidos são: Clínica Geral, Pediatria, Trauma e Odontologia.', NULL, 22, '2020-10-05 20:02:00+00', '2020-10-05 20:02:00+00');
INSERT INTO public.units VALUES ('14.702.257/0013-33', 'UPA Icuí', 'Estr. Icuí-Guajará, Nº 895', 'Ananindeua', 'PA', '67.125-250', NULL, 'https://isac.org.br/wp-content/uploads/2020/05/UPA-Icuí-Logo-B.png', 'upa', 'O Termo de Colaboração da UPA Icuí,situada na cidade de Ananindeua (PA), iniciou em 30/01/2020, com duração de 60 meses.', NULL, 24, '2020-10-05 20:14:29+00', '2020-10-05 20:14:29+00');
INSERT INTO public.units VALUES ('14.702.257/0012-52', 'UPA Irmã Dulce', 'R Curimã, SN, Praia do Francês, Marechal Deodoro', 'Maceió', 'AL', '57.160-000', '(82) 3260-1436', 'https://isac.org.br/wp-content/uploads/2020/05/Logo-PNG.png', 'upa', 'O Contrato de Gestão da UPA 24 hs Irmã Dulce, situada na cidade de Marechal Deodoro (AL), iniciou em 06 de março de 2019 e com duração de 60 meses.A Unidade realiza, em média, 4,5 mil atendimentos por mês. A área de atendimento oferecida é de clínica médica. A UPA possui capacidade para atender até 20 pacientes simultaneamente. Os atendimentos oferecidos são em Clínica Geral.', NULL, 25, '2020-10-05 20:29:55+00', '2020-10-05 20:29:55+00');
INSERT INTO public.units VALUES ('14.702.257/0003-61', 'UPA Trapiche da Barra', 'R Cabo Reis, SN, Ponta Grossa', 'Maceió', 'AL', '57.014-260', '(82) 3022-0033', 'https://isac.org.br/wp-content/uploads/2020/05/Logo-PNG-trapiche.png', 'upa', 'O Contrato de Gestão da Unidade de Pronto Atendimento – UPA Trapiche de Barra, situada na cidade de Maceió (AL), iniciou-se em 01 de setembro de 2015 e com duração de cinco anos. A Unidade tem capacidade para atender até 350 pacientes por dia. Sua área de abrangência é de 200 a 300 mil habitantes e oferece atendimentos de Clínica Geral, Pediatria, Ortopedia e Odontologia. A unidade possui Sala Amarela (11 Leitos); Sala Vermelha (quatro Leitos); Classificação de Risco; Sala de Medicação; Sala de Nebulização; sete Consultórios; Sala de Gesso; Laboratório e Raio XECG.', NULL, 26, '2020-10-05 21:14:10+00', '2020-10-05 21:14:10+00');
INSERT INTO public.units VALUES ('14.702.257/0009-57', 'HMC - Hospital Municipal de Campanha', 'Av Filadélfia, Nº 568, Setor Oeste', 'Araguaína', 'TO', '77.816-540', '(63) 3411-8598', 'https://isac.org.br/wp-content/uploads/2020/10/hmc-logo.png', 'covid', NULL, 'https://isac.org.br/wp-content/uploads/2020/09/Organograma-COVID19.png', 28, '2020-10-08 18:48:33+00', '2020-10-08 18:48:33+00');
