INSERT INTO public.adm_structures VALUES ('Diretora Administrativa', 'Sivanilda Mariano Pinto de Sousa', 'dir.adm@upaaraguaina.med.br', 'Enfermeira formada pelo UNITPAC, especialização em Docência Universitária, cursando MBA em Auditoria, Planejamento e Gestão em Saúde. Atuação na coordenação de Unidades Básicas de Saúde, na coordenação do Serviço de Atendimento Hospitalar-SAD pela SMS, no NEP pela Pró-Saúde e na coordenação da Unidade de Pronto Atendimento pelo IBGH. Atualmente é Diretora Administrativa na UPA Anatólio Dias Carneiro, Araguaína (TO).', 3, 1, '2020-10-05 14:48:24+00', '2020-10-05 14:48:24+00');
INSERT INTO public.adm_structures VALUES ('Diretora Técnica', 'Jullyanna Alves da Silva', 'dir.tecnica@upaaraguaina.med.br', 'Médica formada pela faculdade de medicina do Planalto Central – FACIPLAC, com especialização em Neurologia Clínica pelo IPEMED. Atualmente é Diretora Técnica da UPA Anatólio Dias Carneiro, Araguaína (TO).', 3, 2, '2020-10-05 14:48:30+00', '2020-10-05 14:48:30+00');
INSERT INTO public.adm_structures VALUES ('Coordenadora Administrativa', 'Jéssica Fonseca Costa', 'adm.uti-hgp@isac-campanha.com.br', 'Graduada em Fisioterapia pelo CEULP/ULBRA. Pós-Graduada Lato Sensu, em nível de especialização em Gestão em Serviços da Saúde pela UCDB. Pós-Graduada Lato Sensu, em Saúde Coletiva (Residência Multiprofissional) pelo CEULP/ULBRA. Atuou como analista em Saúde na Secretaria Municipal de Saúde de Palmas (TO) e como analista de dados no Projeto Todos Pela Saúde da Fundação Itaú Social. Atualmente é Coordenadora Administrativa da UTI COVID-19 do Hospital Geral de Palmas (TO).', 4, 3, '2020-10-05 18:42:27+00', '2020-10-05 18:42:27+00');
INSERT INTO public.adm_structures VALUES ('Diretor Técnico', 'Márcio Miranda Brito', 'dir.tecnica@hma-to.med.br', 'Médico formado pelo UNITPAC, Residência Médica em Pediatria pelo Hospital Municipal Infantil Menino Jesus, Residência Médica em Cardiologia Pediátrica pelo INCOR HC/FMUSP, Complementação especializada em Ecocardiografia Pediátrica e Fetal pelo INCOR HC/FMUSP, Especialista em ECMO pela ELSO/LATAM, Especialista em Terapia Intensiva Pediátrica pela AMIB, Mestre em Ciências pelo IEP - HSL, Doutorando em Medicina pela FMUSP, MBA executivo em gestão hospitalar. Atualmente é Diretor Técnico do Hospital Municipal de Araguaína e Coordenador da UTI Pediátrica do HMA.', 5, 4, '2020-10-05 18:44:41+00', '2020-10-05 18:44:41+00');
INSERT INTO public.adm_structures VALUES ('Diretora Geral', 'Kamyla Oliveira Borges Bastos', 'diretoria@hospigaf.med.br', 'Graduada em Administração pela Universidade Anhanguera - UNIDERP e Pós-Graduanda em MBA em Gestão Hospitalar, Clínicas e Consultórios pela Centro Universitário Tiradentes - UNIT. Atualmente é Diretora Geral do Hospital Geral Professor Ib Gatto Falcão – Hospigaf.', 6, 6, '2020-10-05 18:59:47+00', '2020-10-05 18:59:47+00');
INSERT INTO public.adm_structures VALUES ('Diretora Geral', 'Cynthia Rosa Santos', 'diretoria@hecc-to.med.br', 'Graduada em Gestão de Serviços de Saúde, Pós-graduada em nível de Aperfeiçoamento em Administração Empresarial e Pós-graduada Lato Sensu MBA em Gestão Estratégica de Projetos, todos pelo Centro Universitário UNA em Belo Horizonte (MG). Atuação como Gerente de Projetos na Secretaria de Estado de Saúde de Minas Gerais, Gerente Administrativo do Apoio do Gabinete da Secretaria Municipal de Saúde de Belo Horizonte, Gerente de Projetos pela Organização Pan-Americana de Saúde e Superintendente Administrativo no Instituto Saúde e Cidadania – ISAC. Atualmente é Diretora Geral do Hospital Estadual de Combate à Covid-19 do Tocantins, situado no Município de Palmas.', 12, 7, '2020-10-05 19:02:12+00', '2020-10-05 19:02:12+00');
INSERT INTO public.adm_structures VALUES ('Diretora Administrativa', 'Mariela Domitilia Lima Borges', 'dir.adm@hma-to.med.br', 'Mini-Currículo: Administradora formada pelo UNITPAC, com especialização em Administração Hospitalar e de Serviços em Saúde pela INESP e Especialização em MBA Executivo em Gestão de Pessoas e Coaching pela INESPO. Atuação na Gerência de Recurso Humanos pela Pro-Saúde no Hospital Municipal de Araguaína, Coordenadora de Hotelaria pelo Hospital Dom Orione. Atualmente é Diretora Administrativa do Hospital Municipal de Araguaína (TO).', 9, 8, '2020-10-05 19:19:21+00', '2020-10-05 19:19:21+00');
INSERT INTO public.adm_structures VALUES ('Coordenadora Administrativa', 'Narita Brito Florentino', 'adm.uti-hrg@isac-campanha.com.br', 'Graduada em Direito pela UNIRG, Graduanda em Gestão Pública pelo Instituto Federal do Tocantins IFTO, Pós-Graduanda em Direito Eleitoral pela UCAM. Atuou pela Direção Multiprofissional e Assessoria Jurídica do Hospital de Referência de Gurupi. Atualmente é Coordenadora Administrativa da UTI COVID-19 do Hospital Regional de Gurupi (TO).', 10, 9, '2020-10-05 19:22:57+00', '2020-10-05 19:22:57+00');
INSERT INTO public.adm_structures VALUES ('Presidente', 'Evane de Lourdes Ferreira Simonassi Corbacho', 'contato@isac.org.br', 'Advogada formada pela Universidade de Direito Monsenhor Messias, Pós-graduada em MBA-Formação Geral Básica para Altos Executivos pela Fundação Getúlio Vargas, MBA-Finanças Corporativas pela PUC Rio de Janeiro. Foi gestora do Banco do Brasil. Atualmente é a Presidente do Instituto Saúde e Cidadania – ISAC.', 20, 10, '2020-10-05 19:30:15+00', '2020-10-05 19:30:15+00');
INSERT INTO public.adm_structures VALUES ('Tesoureira', 'Sandra Maria Deotti Carvalho', 'contato@isac.org.br', 'Médica formada pela Universidade Federal de Juiz de Fora (MG) e Mestre em Saúde Pública pela Escola Nacional de Saúde Pública de Havana, Cuba. Especializada em Saúde Pública pelo Centro São Camilo de Desenvolvimento em Administração da Saúde. Prestadora de Serviços na Organização Pan Americana de Saúde – OPAS. Atualmente é a Tesoureira do Instituto Saúde e Cidadania – ISAC.', 20, 11, '2020-10-05 19:30:22+00', '2020-10-05 19:30:22+00');
INSERT INTO public.adm_structures VALUES ('Superintendente Financeiro', 'Karlos Antonio Monteiro Sousa', 'financeiro@isac.org.br', 'Graduado em Administração pela Faculdade Projeção e Pós Graduando em MBA em Gestão de Finanças Empresariais. Realizou curso de Boas Práticas e Compliance no CRA-DF. Atuou como Coordenador da Clínica de Ortopedia Sudoeste e no Hospital Santa Luzia (Rede Dor). Atualmente é o Superintendente Financeiro do Instituto Saúde e Cidadania - ISAC.', 20, 12, '2020-10-05 19:30:29+00', '2020-10-05 19:30:29+00');
INSERT INTO public.adm_structures VALUES ('Diretora Geral', 'Karol Silva Oliveira', 'diretoria@mcs-carlosgomes.med.br', 'Graduada em Odontologia pela Escola Baiana de Medicina e Saúde Pública - EBMSP e atualização em Prótese Dentária pela Instituto Prime de Ensino Personalizado. Atualmente é Diretora Geral no Multicentro de Saúde Carlos Gomes.', 11, 13, '2020-10-05 19:36:31+00', '2020-10-05 19:36:31+00');
INSERT INTO public.adm_structures VALUES ('Gerente de Operações', 'Kamyla Oliveira Borges Bastos', 'gerop.bahia@isac.org.br', 'Graduada em Administração pela Universidade Anhanguera - UNIDERP e Pós-Graduanda em MBA em Gestão Hospitalar, Clínicas e Consultórios pela Centro Universitário Tiradentes - UNIT. Atua como Gerente de Operações do Multicentro de Saúde Carlos Gomes e Multicentro de Saúde Vale das Pedrinhas.', 11, 14, '2020-10-05 19:36:39+00', '2020-10-05 19:36:39+00');
