INSERT INTO public.adm_structures VALUES ('Gerente de Operações', 'Kamyla Oliveira Borges Bastos', 'gerop.bahia@isac.org.br', 'Graduada em Administração pela Universidade Anhanguera - UNIDERP e Pós-Graduanda em MBA em Gestão Hospitalar, Clínicas e Consultórios pela Centro Universitário Tiradentes - UNIT. Atua como Gerente de Operações do Multicentro de Saúde Carlos Gomes e Multicentro de Saúde Vale das Pedrinhas.', 18, 18, '2020-10-05 19:57:16+00', '2020-10-05 19:57:16+00');
