INSERT INTO public.adm_structures VALUES ('Diretora Geral', 'Juliana Monteiro Costa Nery', 'diretoria@upacidadenova.med.br', 'Tecnóloga em Gestão Hospitalar pela UNIDERP, possui MBA em Auditoria em Saúde pelo UNINTER e cursa MBA em Gestão de Processos pela UNIASSELVI. Trabalhou na área administrativa em unidades pertencentes a Secretaria de Saúde de Ananindeua. Foi Gerente na UPA Daniel Berg. Atualmente é Diretora Geral da UPA Dom Helder Câmara, Ananindeua (PA).', 22, 20, '2020-10-05 20:02:12+00', '2020-10-05 20:02:12+00');
INSERT INTO public.adm_structures VALUES ('Diretora Geral', 'Nerilene P. Ferreira Braga', 'diretoria@upaicui.med.br', 'Formada em Gestão Empresarial pela Universidade Paulista - UNIP, MBA em Gestão financeira e Controladoria pelo Instituto Carrera e Cursando MBA em Gestão em Organizações de Saúde, Hospitais & Clínicas na Dalmass Escola de Líderes. Atuou como analista financeiro do setor privado e como analista financeiro do setor público. Atualmente é Diretora Geral da UPA - Unidade de Pronto Atendimento Daniel Berg.', 24, 22, '2020-10-05 20:14:33+00', '2020-10-05 20:14:33+00');
INSERT INTO public.adm_structures VALUES ('Diretora Geral', 'Terezinha Inês Bruno', 'diretoria@upairmadulce.med.br ', 'Formada em Gestão Hospitalar pela FAA, cursando MBA em Gestão de Pessoas por Competências e Indicadores em coaching pela IPOG. Realizou cursos de Desenvolvimento em Liderança pelo SENAC (AL), Formação de Avaliadores Metodologia SBA/ONA pelo IBES e Curso Introdutório à Filosofia de Gestão LEAN na Saúde pela Aleph Consultoria. Atuou na coordenação administrativa na UPA Dr. Roosevelt Falcão Cavalcanti, em Maceió (AL). Atualmente é Diretora Geral da UPA Irmã Dulce, Marechal Deodoro (AL).', 25, 23, '2020-10-05 20:30:20+00', '2020-10-05 20:30:20+00');
